import axios from 'axios'

export const SHOW_PRODUCTS = 'SHOW_PRODUCTS'

export function showProducts() {

    const products = [
        {id : 1 , name : "p1" , referencia : "#1" , precio : 1 },
        {id : 2 , name : "p2" , referencia : "#2" , precio : 2 }
    ]
    
    return {
        type : SHOW_PRODUCTS,
        payload: products
    }
    
    
}
